import React from "react";
import { Route, Routes } from "react-router-dom";
import { Login, SignIn, Home, Mensajes, SubirImagen, Notification, Perfil, EditarPerfil, Image } from "./pages";

const App = () => {

  return (
    <Routes>
      <Route path="/" element={<Login />} />
      <Route path="/register" element={<SignIn />} />
      <Route path="/home" element={<Home />} />
      <Route path="/mensajeria" element={<Mensajes />} />
      <Route path="/subir-imagen" element={<SubirImagen />} />
      <Route path="/notificaciones" element={<Notification/>}/>
      <Route path="/perfil" element={<Perfil
    nombre= "Alex Valdes"
    seguidores= {1000}
    pais= "Colombia"
    ejemploImg="https://www.fayerwayer.com/resizer/dFDSLv4dHrkcEteV06yZ3eQ9HNY=/800x0/filters:format(jpg):quality(70)/cloudfront-us-east-1.images.arcpublishing.com/metroworldnews/AFMOVVBDTZATHHAXSMOOHW3HGI.jpeg"
    perfilImg="https://cdn.pixabay.com/photo/2015/10/05/22/37/blank-profile-picture-973460_960_720.png"
    portadaImg="data:image/jpeg;base64,"
/>}/>
      <Route path="/editar-perfil" element={<EditarPerfil/>}/>
      <Route path="/image" element={<Image/>}/>
    </Routes>
  );
};

export default App;
